/*Table structure for table `produto` */

DROP TABLE IF EXISTS `produto`;

CREATE TABLE `produto` (
  `codigo` varchar(13) NOT NULL,
  `unidade_codigo` int(10) unsigned NOT NULL,
  `fornecedor_codigo` int(10) unsigned NOT NULL,
  `descricao` varchar(50) DEFAULT NULL,
  `vlrCompra` double(9,2) DEFAULT NULL,
  `vlrVenda` double(9,2) DEFAULT NULL,
  `estoqueAtual` int(10) unsigned DEFAULT NULL,
  `estoqueCritico` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`codigo`,`unidade_codigo`,`fornecedor_codigo`),
  KEY `produto_FKIndex1` (`fornecedor_codigo`),
  KEY `produto_FKIndex2` (`unidade_codigo`),
  CONSTRAINT `produto_ibfk_1` FOREIGN KEY (`fornecedor_codigo`) REFERENCES `fornecedor` (`codigo`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `produto_ibfk_2` FOREIGN KEY (`unidade_codigo`) REFERENCES `unidade` (`codigo`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

